import React, { useState } from "react";

export default function Profile() {
  const [form, setForm] = useState({
    name: "Jane Doe",
    email: "jane@example.com",
    password: "password123",
  });

  function handleChange(e) {
    setForm({ ...form, [e.target.name]: e.target.value });
  }

  function handleSubmit(e) {
    e.preventDefault();
    alert("Profile updated!");
  }

  return (
    <div className="bg-gradient-to-br from-blue-50 via-white to-blue-100 rounded-2xl shadow-xl p-8 max-w-lg mx-auto mt-8">
      <div className="font-bold text-blue-900 text-2xl mb-6 flex items-center gap-2">
        <span className="material-icons text-yellow-400">person</span>
        Profile Settings
      </div>
      <form onSubmit={handleSubmit} className="space-y-6">
        <div>
          <label className="block mb-2 font-semibold text-blue-900">Name</label>
          <input
            className="w-full border-2 border-blue-200 px-4 py-3 rounded-lg focus:border-blue-500 focus:ring-2 focus:ring-blue-100 transition"
            name="name"
            value={form.name}
            onChange={handleChange}
            required
            autoComplete="off"
          />
        </div>
        <div>
          <label className="block mb-2 font-semibold text-blue-900">Email</label>
          <input
            className="w-full border-2 border-blue-200 px-4 py-3 rounded-lg focus:border-blue-500 focus:ring-2 focus:ring-blue-100 transition"
            name="email"
            type="email"
            value={form.email}
            onChange={handleChange}
            required
            autoComplete="off"
          />
        </div>
        <div>
          <label className="block mb-2 font-semibold text-blue-900">Password</label>
          <input
            className="w-full border-2 border-blue-200 px-4 py-3 rounded-lg focus:border-blue-500 focus:ring-2 focus:ring-blue-100 transition"
            name="password"
            type="password"
            value={form.password}
            onChange={handleChange}
            required
            autoComplete="off"
          />
        </div>
        <button className="bg-gradient-to-r from-blue-500 to-blue-700 text-white px-6 py-3 rounded-lg font-bold shadow-lg hover:scale-105 transition-transform" type="submit">
          <span className="material-icons align-middle mr-2">save</span>
          Save Changes
        </button>
      </form>
    </div>
  );
}
